import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import App2 from './app2'


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App username='Aryan' age='17' />
    <App username='Aditya' age='25'/>
    <App2/>
  </React.StrictMode>
);
